import React from 'react'
import {
 Container, CssBaseline,
} from '@mui/material';
import { CustomAppBar } from './components/CustomAppBar';


function App() {

  return (
    <>
      <CssBaseline />
      <CustomAppBar />
      <Container component="main" maxWidth="sm" sx={{ mb: 4 }}>
      </Container>
    </>
  )
}

export default App
